from api.permissions import IsOwnerReadOnly
from api.serializers import UserSerializer, ChirpSerializer
from django.contrib.auth.models import User
from django.http import HttpResponse
from rest_framework import generics, permissions
from updates.models import Chirp




class ChirpListCreateView(generics.ListCreateAPIView):
    permission_classes = (permissions.IsAuthenticatedOrReadOnly,
                          IsOwnerReadOnly)
    queryset = Chirp.objects.all()
    serializer_class = ChirpSerializer

    def perform_create(self, serializer):
        user = User.objects.get(pk=1)
        serializer.save(author=user)

class ChirpDetailAndUpdate(generics.RetrieveUpdateDestroyAPIView):
    permission_classes = (permissions.IsAuthenticatedOrReadOnly,
                          IsOwnerReadOnly)
    queryset = Chirp.objects.all()
    serializer_class = ChirpSerializer


class UserList(generics.ListAPIView):
    queryset = User.objects.all()
    serializer_class = UserSerializer


class UserDetail(generics.RetrieveAPIView):
    queryset = User.objects.all()
    serializer_class = UserSerializer

